'use client'

import React, { useState, useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import logo from './assets/logo.jpeg';
import perfilIcon from './assets/perfil.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css';
import MenuLateral from './MenuLateral.js'; 

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const isAdmin = localStorage.getItem('isAdmin') === 'true';
  const [nombreUsuario, setNombreUsuario] = useState('');
  const [menuLateralAbierto, setMenuLateralAbierto] = useState(false);

  const toggleMenuLateral = () => {
    setMenuLateralAbierto(!menuLateralAbierto); 
  };

  useEffect(() => {
    const nombre = localStorage.getItem('nombre');
    setNombreUsuario(nombre || 'Invitado');
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    setNombreUsuario('Invitado');
    navigate('/login');
  };

  const handleProfileClick = () => {
    navigate('/configuracion-perfil');
  };

  const isActive = (path) => {
    return location.pathname === path;
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg custom-navbar navbar-dark bg-dark">
        <div className="container-fluid">
          <div className="navbar-brand d-flex align-items-center">
            <img src={logo} alt="Logo" className="profile-logo me-2" />
            <span className="navbar-brand-title">Mario Hugo</span>
          </div>

          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a 
                  className={`nav-link ${isActive('/inicio') ? 'active text-white' : 'text-secondary'}`} 
                  href="/inicio"
                >
                  Inicio
                </a>
              </li>
              <li className="nav-item">
                <a 
                  className={`nav-link ${isActive('/catalogo') ? 'active text-white' : 'text-secondary'}`} 
                  href="/catalogo"
                >
                  CatÃ¡logo
                </a>
              </li>
              <li className="nav-item">
                <a 
                  className={`nav-link ${isActive('/historial') ? 'active text-white' : 'text-secondary'}`} 
                  href="/historial"
                >
                  Historial
                </a>
              </li>
              {isAdmin && (
                <li className="nav-item">
                  <a 
                    className={`nav-link ${isActive('/libros') ? 'active text-white' : 'text-secondary'}`} 
                    href="/libros"
                  >
                    Libros
                  </a>
                </li>
              )}
              {isAdmin && (
                <li className="nav-item">
                  <a 
                    className={`nav-link ${isActive('/usuarios') ? 'active text-white' : 'text-secondary'}`} 
                    href="/usuarios"
                  >
                    Usuarios
                  </a>
                </li>
              )}
            </ul>

            <div
              className="profile d-flex align-items-center"
              style={{ cursor: 'pointer' }}
              onClick={toggleMenuLateral}
            >
              <span className="profile-text me-2">{nombreUsuario}</span>
              <img src={perfilIcon} alt="Icono de Perfil" className="profile-icon" />
            </div>
          </div>
        </div>
      </nav>

      <MenuLateral
        isOpen={menuLateralAbierto}
        toggleMenu={toggleMenuLateral}
        handleLogout={handleLogout}
        handleProfileClick={handleProfileClick}
      />
    </div>
  );
};

export default Navbar;
